(61097, 60006, 1, 1, 1, 1, 1, 1, '', '', '', 'https://c1.scryfall.com/file/scryfall-cards/small/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/normal/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/large/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/png/front/f/e/fea4a077-718b-44af-87be-90df61aab643.png?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/art_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/border_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', '{2}{R}', 'What', 'Destroy target artifact.', '', '', '', 'Instant', 'instant', ''),
(61098, 60006, 2, 1, 1, 1, 1, 1, '', '', '', 'https://c1.scryfall.com/file/scryfall-cards/small/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/normal/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/large/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/png/front/f/e/fea4a077-718b-44af-87be-90df61aab643.png?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/art_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/border_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', '{2}{U}', 'When', 'Counter target creature spell.', '', '', '', 'Instant', 'instant', ''),
(61099, 60006, 3, 1, 1, 1, 1, 1, '', '', '', 'https://c1.scryfall.com/file/scryfall-cards/small/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/normal/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/large/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/png/front/f/e/fea4a077-718b-44af-87be-90df61aab643.png?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/art_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/border_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', '{3}{B}', 'Where', 'Destroy target land.', '', '', '', 'Instant', 'instant', ''),
(61100, 60006, 4, 1, 1, 1, 1, 1, '', '', '', 'https://c1.scryfall.com/file/scryfall-cards/small/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/normal/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/large/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/png/front/f/e/fea4a077-718b-44af-87be-90df61aab643.png?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/art_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', 'https://c1.scryfall.com/file/scryfall-cards/border_crop/front/f/e/fea4a077-718b-44af-87be-90df61aab643.jpg?1583542846', '{1}{G}', 'Why', 'Destroy target enchantment.', '', '', '', 'Instant', 'instant', '');
