INSERT INTO card_rulings (id, oracle_id, comment_hash, source, published_at, comment) VALUES
(23303, '86790a10-c564-44b7-a177-1e66ab9afe77', '8cf4b737a31b599363444d08ac06dfe0', 'wotc', '2021-03-19', 'If you copy a spell that’s half of a split card, the copy copies that same half. For example, if you copy Dead, the copy is also Dead, not Gone.'),
(23304, '86790a10-c564-44b7-a177-1e66ab9afe77', '37945e7e9b74fd15aad054845cc96edd', 'wotc', '2021-03-19', 'Each split card has two names. If an effect instructs you to choose a card name, you may choose one of those names, but not both.'),
(23305, '86790a10-c564-44b7-a177-1e66ab9afe77', 'd247665bc23fbb7a2fb169c997720bac', 'wotc', '2021-03-19', 'To cast a split card, you choose one half to cast.'),
(23306, '86790a10-c564-44b7-a177-1e66ab9afe77', 'f8dc0764af2688f50e4913ec64a43721', 'wotc', '2021-03-19', 'Each split card is a single card. For example, if you discard a split card, you’ve discarded one card, not two. If an effect counts the number of instant and sorcery cards in your graveyard, Dead // Gone counts once, not twice.'),
(23307, '86790a10-c564-44b7-a177-1e66ab9afe77', '6288c2dcd7da9c9f0dc79a1e2de7f5ec', 'wotc', '2021-03-19', 'All split cards have two card faces on a single card, and you put a split card onto the stack as only the half you’re casting. The characteristics of the half of the card you didn’t cast are ignored while the spell is on the stack.'),
(23308, '86790a10-c564-44b7-a177-1e66ab9afe77', '157669803c68417bbc9539992401ae1c', 'wotc', '2021-03-19', 'While not on the stack, the characteristics of a split card are the combination of its two halves. For example, Dead // Gone has a mana value of 4. This means that if an effect allows you to search for a card with mana value 2 or less, you can’t find Dead // Gone.'),
(23309, '86790a10-c564-44b7-a177-1e66ab9afe77', 'a1907a8f25fd1cec19f542c6688f2786', 'wotc', '2021-03-19', 'If an effect allows you to cast a spell with certain characteristics, consider only the half you’re casting. For example, if an effect allows you to cast a spell with mana value 2 or less from your hand, you can cast Dead but not Gone.'),
(24996, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '2f484670fd40c6847d10aeba7b0e7009', 'wotc', '2017-04-18', 'Each split card is a single card. For example, if you discard one, you’ve discarded one card, not two. If an effect counts the number of instant and sorcery cards in your graveyard, Destined // Lead counts once, not twice.'),
(24997, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '0ba02c768bc043c7f5e281de80e3b783', 'wotc', '2017-04-18', 'While not on the stack, the characteristics of a split card are the combination of its two halves. For example, Destined // Lead is a green and black card, it is both an instant card and a sorcery card, and its converted mana cost is 6. This means that if an effect allows you to cast a card with converted mana cost 2 from your hand, you can’t cast Destined. This is a change from the previous rules for split cards.'),
(24998, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', 'ebe02cdb38ad80e927a349c56363afa7', 'wotc', '2017-04-18', 'Each split card has two names. If an effect instructs you to choose a card name, you may choose one, but not both.'),
(24999, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', 'ba1c80e7d7bb9f47d6660b18d28ff5a8', 'wotc', '2017-04-18', 'If another effect allows you to cast a split card with aftermath from a graveyard, you may cast either half. If you cast the half that has aftermath, you’ll exile the card if it would leave the stack.'),
(25000, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', 'cabf6c1abc205d48e4b6d43f5075d53a', 'wotc', '2017-04-18', 'If you cast the first half of a split card with aftermath during your turn, you’ll have priority immediately after it resolves. You can cast the half with aftermath from your graveyard before any player can take any other action if it’s legal for you to do so.'),
(25001, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '69117b7ed73a9cf17c3102d87304d884', 'wotc', '2017-04-18', 'All split cards have two card faces on a single card, and you put a split card onto the stack with only the half you’re casting. The characteristics of the half of the card you didn’t cast are ignored while the spell is on the stack. For example, if an effect prevents you from casting green spells, you can cast Destined of Destined // Lead, but not Lead.'),
(25002, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '3f21d39762800c5df48491c9b48a4b2a', 'wotc', '2017-04-18', 'A spell with aftermath cast from a graveyard will always be exiled afterward, whether it resolves, it’s countered, or it leaves the stack in some other way.'),
(25003, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '591103d0d78b72e1fcb9c2598bcadcb4', 'wotc', '2017-04-18', 'If another effect allows you to cast a split card with aftermath from any zone other than a graveyard, you can’t cast the half with aftermath.'),
(25004, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '1d9635721b95f4c54025f9d6a329946c', 'wotc', '2017-04-18', 'Split cards with aftermath have a new frame treatment—the half you can cast from your hand is oriented the same as other cards you’d cast from your hand, while the half you can cast from your graveyard is a traditional split card half. This frame treatment is for your convenience and has no rules significance.'),
(25005, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '37b6c89723b90c93447182363615b5bf', 'wotc', '2017-07-14', 'Once you’ve started to cast a spell with aftermath from your graveyard, the card is immediately moved to the stack. Opponents can’t try to stop the ability by exiling the card with an effect such as that of Crook of Condemnation.'),
(26141, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'a033d9a3c28c335785f3f569c7819299', 'wotc', '2013-06-07', 'Although originally printed with a characteristic-defining ability that defined its color, this card now has a color indicator. This color indicator can’t be affected by text-changing effects (such as the one created by Crystal Spray), although color-changing effects can still overwrite it.'),
(26142, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '71709a16bfb77fcbf5d8d4b577c9cbe7', 'wotc', '2021-06-18', 'If the first triggered ability of suspend (the one that removes time counters) is countered, no time counter is removed. The ability will trigger again at the beginning of the card’s owner’s next upkeep.'),
(26143, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'cc418272d4b3086f2604c2635c37d587', 'wotc', '2021-06-18', 'If you can’t cast the card, perhaps because there are no legal targets available, it remains exiled with no time counters on it, and it’s no longer suspended.'),
(26144, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '27c6d1686650105a4baa9c749c7fbc8c', 'wotc', '2021-06-18', 'Suspend is a keyword that represents three abilities. The first is a static ability that allows you to exile the card from your hand with the specified number of time counters (the number before the dash) on it by paying its suspend cost (listed after the dash). The second is a triggered ability that removes a time counter from the suspended card at the beginning of each of your upkeeps. The third is a triggered ability that causes you to cast the card when the last time counter is removed. If you cast a creature spell this way, it gains haste until you lose control of that creature (or, in rare cases, you lose control of the creature spell while it’s on the stack).'),
(26145, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'c26c8eb5f30722b2a7382e2a8c20ce57', 'wotc', '2021-06-18', 'When the last time counter is removed, the second triggered ability of suspend (the one that lets you cast the card) triggers. It doesn’t matter why the last time counter was removed or what effect removed it.'),
(26146, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '065633fc6070f81dd5a700e4d2857b04', 'wotc', '2021-06-18', 'If the spell requires any targets, those targets are chosen when the spell is finally cast, not when it’s exiled.'),
(26147, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '52111c839b1c54b77b04f6e26021955e', 'wotc', '2021-06-18', 'A card with no mana cost can’t be cast normally; you’ll need a way to cast it for an alternative cost or without paying its mana cost, such as by suspending it.'),
(26148, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '0c1349fde42a1c4fece8255335420b87', 'wotc', '2021-06-18', 'Cards exiled with suspend are exiled face up.'),
(26149, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'e048f35715af61a4fd2c992746f27b5a', 'wotc', '2021-06-18', 'Exiling a card with suspend isn’t casting that card. This action doesn’t use the stack and can’t be responded to.'),
(26150, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '89dac9d78cad109a5e0badd12be76d56', 'wotc', '2021-06-18', 'You are never forced to activate mana abilities to pay costs, so if there is a mandatory additional mana cost (such as from Thalia, Guardian of Thraben), you can decline to activate mana abilities to pay for it and hence fail to cast the suspended card, leaving it in exile.'),
(26151, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '3336498ac9a828d911c44bee0ec0a721', 'wotc', '2021-06-18', 'You can exile a card in your hand using suspend any time you could cast that card. Consider its card type, any effects that modify when you could cast it (such as flash) and any other effects that stop you from casting it (such as from Meddling Mage’s ability) to determine if and when you can do this. Whether you could actually complete all steps in casting the card is irrelevant. For example, you can exile a card with suspend that has no mana cost or that requires a target even if no legal targets are available at that time.'),
(26152, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'da6f7a7c53eab8b78755aeccfbbcb2e3', 'wotc', '2021-06-18', 'If the card has {X} in its mana cost, you must choose 0 as the value of X when casting it without paying its mana cost.'),
(26153, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '367e2abd6ef5bd9b84927c10122e7fc0', 'wotc', '2021-06-18', 'If the second triggered ability is countered, the card can’t be cast. It remains exiled with no time counters on it, and it’s no longer suspended.'),
(26154, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '36524d677c0368735d811cb11e7cea59', 'wotc', '2021-06-18', 'If an effect refers to a “suspended card,” that means a card that (1) has suspend, (2) is in exile, and (3) has one or more time counters on it.'),
(26155, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '9cb4ecdd3f00671f82ea533145ff4845', 'wotc', '2021-06-18', 'If a card with no mana cost is given an alternative cost equal to its mana cost (by Snapcaster Mage, for example), that cost cannot be paid and the card cannot be cast this way.'),
(26156, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'eadfae96f3b6b5526ed9031d99e21c8b', 'wotc', '2021-06-18', 'As the second triggered ability resolves, you must cast the card if able. You must do so even if it requires targets and the only legal targets are ones that you really don’t want to target. Timing permissions based on the card’s type are ignored.'),
(26157, '9728dec9-d482-4c7a-8cdc-44d010dc878d', 'f43f6ef714a2523a2c783c95fdd37a81', 'wotc', '2021-06-18', 'The mana value of a spell cast without paying its mana cost is determined by its mana cost, even though that cost wasn’t paid.'),
(26158, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '1ec58cd32e7ced3cd1bb052e74c4d5ba', 'wotc', '2021-06-18', 'If you cast a card “without paying its mana cost,” such as with suspend, you can’t choose to cast it for any alternative costs. You can, however, pay additional costs. If the card has any mandatory additional costs, you must pay those if you want to cast the card.'),
(37883, 'db1ea6e0-4076-49dd-92f7-7e6d7eb65a27', '9acc44465d601846825f4acb4d7a5aaf', 'wotc', '2016-01-22', 'If an effect states that Endbringer doesn’t untap during your untap step, that effect won’t apply during another player’s untap step.'),
(37884, 'db1ea6e0-4076-49dd-92f7-7e6d7eb65a27', '411fe9104ac8e6e9280b00bf235a69e7', 'wotc', '2016-01-22', 'Endbringer untaps at the same time as the active player’s permanents. You can’t choose to not untap it at that time.'),
(37885, 'db1ea6e0-4076-49dd-92f7-7e6d7eb65a27', 'cb38506646bc253f500321fff81c0687', 'wotc', '2016-01-22', 'Activating the second activated ability after a creature has legally been declared as an attacker or blocker won’t change or undo that attack or block.'),
(42044, 'f2c10591-4c0c-4286-af91-e8d8d10a4c9d', '876267d164c317656dc5ea90debf94a6', 'wotc', '2016-04-08', 'When Thing in the Ice’s triggered ability removes the last counter from it, Awoken Horror’s ability will trigger and resolve before the spell that caused Thing in the Ice’s last ability to trigger.'),
(42045, 'f2c10591-4c0c-4286-af91-e8d8d10a4c9d', '0807c16f77feb82b015bfb427a03cd4d', 'wotc', '2016-04-08', 'Removing all ice counters from Thing in the Ice some other way will not cause it to transform. You’ll need to cast an instant or sorcery spell and cause its last ability to trigger.'),
(42046, 'f2c10591-4c0c-4286-af91-e8d8d10a4c9d', '3ca28636e4811174b9988e9e42836f93', 'wotc', '2016-07-13', 'For more information on double-faced cards, see the Shadows over Innistrad mechanics article (http://magic.wizards.com/en/articles/archive/feature/shadows-over-innistrad-mechanics).');
INSERT INTO card_rulings_list (id, oracle_id, rulings_json) VALUES
(6752, '86790a10-c564-44b7-a177-1e66ab9afe77', '[{\"id\": 23303, \"comment\": \"If you copy a spell that’s half of a split card, the copy copies that same half. For example, if you copy Dead, the copy is also Dead, not Gone.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23304, \"comment\": \"Each split card has two names. If an effect instructs you to choose a card name, you may choose one of those names, but not both.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23305, \"comment\": \"To cast a split card, you choose one half to cast.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23306, \"comment\": \"Each split card is a single card. For example, if you discard a split card, you’ve discarded one card, not two. If an effect counts the number of instant and sorcery cards in your graveyard, Dead // Gone counts once, not twice.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23307, \"comment\": \"All split cards have two card faces on a single card, and you put a split card onto the stack as only the half you’re casting. The characteristics of the half of the card you didn’t cast are ignored while the spell is on the stack.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23308, \"comment\": \"While not on the stack, the characteristics of a split card are the combination of its two halves. For example, Dead // Gone has a mana value of 4. This means that if an effect allows you to search for a card with mana value 2 or less, you can’t find Dead // Gone.\", \"published_at\": \"2021-03-19\"}, {\"id\": 23309, \"comment\": \"If an effect allows you to cast a spell with certain characteristics, consider only the half you’re casting. For example, if an effect allows you to cast a spell with mana value 2 or less from your hand, you can cast Dead but not Gone.\", \"published_at\": \"2021-03-19\"}]'),
(7260, '8fe7436b-2467-486e-8a2d-7cbf21a65da9', '[{\"id\": 24996, \"comment\": \"Each split card is a single card. For example, if you discard one, you’ve discarded one card, not two. If an effect counts the number of instant and sorcery cards in your graveyard, Destined // Lead counts once, not twice.\", \"published_at\": \"2017-04-18\"}, {\"id\": 25005, \"comment\": \"Once you’ve started to cast a spell with aftermath from your graveyard, the card is immediately moved to the stack. Opponents can’t try to stop the ability by exiling the card with an effect such as that of Crook of Condemnation.\", \"published_at\": \"2017-07-14\"}, {\"id\": 25004, \"comment\": \"Split cards with aftermath have a new frame treatment—the half you can cast from your hand is oriented the same as other cards you’d cast from your hand, while the half you can cast from your graveyard is a traditional split card half. This frame treatment is for your convenience and has no rules significance.\", \"published_at\": \"2017-04-18\"}, {\"id\": 25003, \"comment\": \"If another effect allows you to cast a split card with aftermath from any zone other than a graveyard, you can’t cast the half with aftermath.\", \"published_at\": \"2017-04-18\"}, {\"id\": 25002, \"comment\": \"A spell with aftermath cast from a graveyard will always be exiled afterward, whether it resolves, it’s countered, or it leaves the stack in some other way.\", \"published_at\": \"2017-04-18\"}, {\"id\": 25000, \"comment\": \"If you cast the first half of a split card with aftermath during your turn, you’ll have priority immediately after it resolves. You can cast the half with aftermath from your graveyard before any player can take any other action if it’s legal for you to do so.\", \"published_at\": \"2017-04-18\"}, {\"id\": 24999, \"comment\": \"If another effect allows you to cast a split card with aftermath from a graveyard, you may cast either half. If you cast the half that has aftermath, you’ll exile the card if it would leave the stack.\", \"published_at\": \"2017-04-18\"}, {\"id\": 24998, \"comment\": \"Each split card has two names. If an effect instructs you to choose a card name, you may choose one, but not both.\", \"published_at\": \"2017-04-18\"}, {\"id\": 24997, \"comment\": \"While not on the stack, the characteristics of a split card are the combination of its two halves. For example, Destined // Lead is a green and black card, it is both an instant card and a sorcery card, and its converted mana cost is 6. This means that if an effect allows you to cast a card with converted mana cost 2 from your hand, you can’t cast Destined. This is a change from the previous rules for split cards.\", \"published_at\": \"2017-04-18\"}, {\"id\": 25001, \"comment\": \"All split cards have two card faces on a single card, and you put a split card onto the stack with only the half you’re casting. The characteristics of the half of the card you didn’t cast are ignored while the spell is on the stack. For example, if an effect prevents you from casting green spells, you can cast Destined of Destined // Lead, but not Lead.\", \"published_at\": \"2017-04-18\"}]'),
(7620, '9728dec9-d482-4c7a-8cdc-44d010dc878d', '[{\"id\": 26150, \"comment\": \"You are never forced to activate mana abilities to pay costs, so if there is a mandatory additional mana cost (such as from Thalia, Guardian of Thraben), you can decline to activate mana abilities to pay for it and hence fail to cast the suspended card, leaving it in exile.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26151, \"comment\": \"You can exile a card in your hand using suspend any time you could cast that card. Consider its card type, any effects that modify when you could cast it (such as flash) and any other effects that stop you from casting it (such as from Meddling Mage’s ability) to determine if and when you can do this. Whether you could actually complete all steps in casting the card is irrelevant. For example, you can exile a card with suspend that has no mana cost or that requires a target even if no legal targets are available at that time.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26152, \"comment\": \"If the card has {X} in its mana cost, you must choose 0 as the value of X when casting it without paying its mana cost.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26153, \"comment\": \"If the second triggered ability is countered, the card can’t be cast. It remains exiled with no time counters on it, and it’s no longer suspended.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26154, \"comment\": \"If an effect refers to a “suspended card,” that means a card that (1) has suspend, (2) is in exile, and (3) has one or more time counters on it.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26155, \"comment\": \"If a card with no mana cost is given an alternative cost equal to its mana cost (by Snapcaster Mage, for example), that cost cannot be paid and the card cannot be cast this way.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26156, \"comment\": \"As the second triggered ability resolves, you must cast the card if able. You must do so even if it requires targets and the only legal targets are ones that you really don’t want to target. Timing permissions based on the card’s type are ignored.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26157, \"comment\": \"The mana value of a spell cast without paying its mana cost is determined by its mana cost, even though that cost wasn’t paid.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26158, \"comment\": \"If you cast a card “without paying its mana cost,” such as with suspend, you can’t choose to cast it for any alternative costs. You can, however, pay additional costs. If the card has any mandatory additional costs, you must pay those if you want to cast the card.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26148, \"comment\": \"Cards exiled with suspend are exiled face up.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26149, \"comment\": \"Exiling a card with suspend isn’t casting that card. This action doesn’t use the stack and can’t be responded to.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26141, \"comment\": \"Although originally printed with a characteristic-defining ability that defined its color, this card now has a color indicator. This color indicator can’t be affected by text-changing effects (such as the one created by Crystal Spray), although color-changing effects can still overwrite it.\", \"published_at\": \"2013-06-07\"}, {\"id\": 26142, \"comment\": \"If the first triggered ability of suspend (the one that removes time counters) is countered, no time counter is removed. The ability will trigger again at the beginning of the card’s owner’s next upkeep.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26143, \"comment\": \"If you can’t cast the card, perhaps because there are no legal targets available, it remains exiled with no time counters on it, and it’s no longer suspended.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26145, \"comment\": \"When the last time counter is removed, the second triggered ability of suspend (the one that lets you cast the card) triggers. It doesn’t matter why the last time counter was removed or what effect removed it.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26146, \"comment\": \"If the spell requires any targets, those targets are chosen when the spell is finally cast, not when it’s exiled.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26147, \"comment\": \"A card with no mana cost can’t be cast normally; you’ll need a way to cast it for an alternative cost or without paying its mana cost, such as by suspending it.\", \"published_at\": \"2021-06-18\"}, {\"id\": 26144, \"comment\": \"Suspend is a keyword that represents three abilities. The first is a static ability that allows you to exile the card from your hand with the specified number of time counters (the number before the dash) on it by paying its suspend cost (listed after the dash). The second is a triggered ability that removes a time counter from the suspended card at the beginning of each of your upkeeps. The third is a triggered ability that causes you to cast the card when the last time counter is removed. If you cast a creature spell this way, it gains haste until you lose control of that creature (or, in rare cases, you lose control of the creature spell while it’s on the stack).\", \"published_at\": \"2021-06-18\"}]'),
(11049, 'db1ea6e0-4076-49dd-92f7-7e6d7eb65a27', '[{\"id\": 37883, \"comment\": \"If an effect states that Endbringer doesn’t untap during your untap step, that effect won’t apply during another player’s untap step.\", \"published_at\": \"2016-01-22\"}, {\"id\": 37884, \"comment\": \"Endbringer untaps at the same time as the active player’s permanents. You can’t choose to not untap it at that time.\", \"published_at\": \"2016-01-22\"}, {\"id\": 37885, \"comment\": \"Activating the second activated ability after a creature has legally been declared as an attacker or blocker won’t change or undo that attack or block.\", \"published_at\": \"2016-01-22\"}]'),
(12273, 'f2c10591-4c0c-4286-af91-e8d8d10a4c9d', '[{\"id\": 42044, \"comment\": \"When Thing in the Ice’s triggered ability removes the last counter from it, Awoken Horror’s ability will trigger and resolve before the spell that caused Thing in the Ice’s last ability to trigger.\", \"published_at\": \"2016-04-08\"}, {\"id\": 42045, \"comment\": \"Removing all ice counters from Thing in the Ice some other way will not cause it to transform. You’ll need to cast an instant or sorcery spell and cause its last ability to trigger.\", \"published_at\": \"2016-04-08\"}, {\"id\": 42046, \"comment\": \"For more information on double-faced cards, see the Shadows over Innistrad mechanics article (http://magic.wizards.com/en/articles/archive/feature/shadows-over-innistrad-mechanics).\", \"published_at\": \"2016-07-13\"}]');
